import React from "react";
import "./Projects.styles.css";
import { motion } from "framer-motion";

function Projects() {
  return (
    <div className="projects main-content">
      <motion.div
        initial="out"
        animate="in"
        exit="out"
        variants={{
          in: {
            opacity: 1,
          },
          out: {
            opacity: 0,
          },
        }}
        transition={{ duration: 0.5 }}
      >
        <h1>Projects</h1>
      </motion.div>
    </div>
  );
}

export default Projects;
